import Container_left_chart from '../container_left_chart/Container_left_chart.js'
import Container_right_chart from '../container_right_chart/Container_right_chart.js'
const Main = () =>{
    return (
        <main>
            <div className='main__container'>
            <Welcome/>

                <div className='main_cards'>
                
                    <Card 
                        fontwesome={'fas fa-file-alt fa-2x text-lightblue'}
