                    <Container_right_chart
                        title={'Daily Reports'}
                        subtitle={'Ubatuba, SÃ£o Paulo, BR'}
                        content = 
                         { <div className="charts__rigth__cards">

                           <Card_container title={'Pagamentos'} vlaue={2500}/>

